(91, '8ecd3fc6-d169-4252-a32b-44336d802567', 13, 'Create', 'App\\Event', 21, 'App\\Event', 21, 'App\\Event', 21, '', 'finished', '', '2019-10-03 15:58:14', '2019-10-03 15:58:14', NULL, '{\"title\":\"EVENT ltesting\",\"image\":\"XfDgFSsEDWWA1ZCfCkqSkcsdSGQsNFGUuU6RQGaH.png\",\"thumbnail\":\"8209843f0ae76d86e912bb6a7a19f3c3766c5142\",\"description\":\"<div><strong><br>Tunisia<\\/strong>,<a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Tunisia#cite_note-18\\\">[a]<\\/a> officially the Tunisian Republic,<a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Tunisia#cite_note-19\\\">[18]<\\/a><a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Tunisia#cite_note-20\\\">[b]<\\/a> is a country in the <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Maghreb\\\">Maghreb<\\/a> region of <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/North_Africa\\\">North Africa<\\/a>, covering 163,610 square kilometres (63,170 square miles). Its northernmost point, <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Cape_Angela\\\">Cape Angela<\\/a>, is the northernmost point on the African continent. It is bordered by <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Algeria\\\">Algeria<\\/a> to the west and southwest, <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Libya\\\">Libya<\\/a> to the southeast, and the <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Mediterranean_Sea\\\">Mediterranean Sea<\\/a> to the north and east. Tunisia\'s population was 11.435 million in 2017.<a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Tunisia#cite_note-ins-12\\\">[12]<\\/a> Tunisia\'s name is derived from its capital city, <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Tunis\\\">Tunis<\\/a>, which is located on its northeast coast.<br><br><\\/div><div><br>Geographically, Tunisia contains the eastern end of the <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Atlas_Mountains\\\">Atlas Mountains<\\/a>, and the northern reaches of the <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Sahara\\\">Sahara<\\/a> desert. Much of the rest of the country\'s land is fertile soil. Its 1,300 kilometres (810 miles) of coastline include the African conjunction of the western and eastern parts of the <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Mediterranean_Basin\\\">Mediterranean Basin<\\/a> and, by means of the <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Sicilian_Strait\\\">Sicilian Strait<\\/a> and <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Sardinia\\\">Sardinian<\\/a> Channel, feature the African mainland\'s second and third nearest points to Europe after <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Gibraltar\\\">Gibraltar<\\/a>.<br><br><\\/div><div><br>Tunisia is a <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Unitary_state\\\">unitary<\\/a> <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Semi-presidential_system\\\">semi-presidential<\\/a> <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Representative_democracy\\\">representative democratic<\\/a> <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Republic\\\">republic<\\/a>. It is considered to be the only fully democratic <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Sovereign_state\\\">sovereign state<\\/a> in the <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Arab_world\\\">Arab world<\\/a>.<a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Tunisia#cite_note-21\\\">[19]<\\/a><a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Tunisia#cite_note-22\\\">[20]<\\/a> It has a high <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Human_development_index\\\">human development index<\\/a>.<a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Tunisia#cite_note-HDI-15\\\">[15]<\\/a> It has an <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/European_Union_Association_Agreement\\\">association agreement<\\/a> with the <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/European_Union\\\">European Union<\\/a>; is a member of <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/La_Francophonie\\\">La Francophonie<\\/a>, the <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Union_for_the_Mediterranean\\\">Union for the Mediterranean<\\/a>, the <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Common_Market_for_Eastern_and_Southern_Africa\\\">Common Market for Eastern and Southern Africa<\\/a>, the <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Arab_Maghreb_Union\\\">Arab Maghreb Union<\\/a>, the <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Arab_League\\\">Arab League<\\/a>, the <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/OIC\\\">OIC<\\/a>, the <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Greater_Arab_Free_Trade_Area\\\">Greater Arab Free Trade Area<\\/a>, the <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Community_of_Sahel-Saharan_States\\\">Community of Sahel-Saharan States<\\/a>, the <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/African_Union\\\">African Union<\\/a>, the <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Non-Aligned_Movement\\\">Non-Aligned Movement<\\/a>, the <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Group_of_77\\\">Group of 77<\\/a>; and has obtained the status of <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Major_non-NATO_ally\\\">major non-NATO ally<\\/a> of the United States. In addition, Tunisia is also a <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Member_states_of_the_United_Nations\\\">member state<\\/a> of the <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/United_Nations\\\">United Nations<\\/a> and a <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/States_parties_to_the_Rome_Statute_of_the_International_Criminal_Court\\\">state party<\\/a> to the <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Rome_Statute_of_the_International_Criminal_Court\\\">Rome Statute of the International Criminal Court<\\/a>. Close relations with Europe, in particular <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/France%E2%80%93Tunisia_relations\\\">with France<\\/a><a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Tunisia#cite_note-23\\\">[21]<\\/a> and <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Italy%E2%80%93Tunisia_relations\\\">with Italy<\\/a>,<a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Tunisia#cite_note-24\\\">[22]<\\/a><a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Tunisia#cite_note-25\\\">[23]<\\/a> have been forged through economic cooperation, <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Privatisation\\\">privatisation<\\/a> and industrial modernization.<br><br><\\/div>\",\"start_date\":\"2019-10-30 11:00:00\",\"end_date\":\"2019-10-30 11:00:00\",\"updated_at\":\"2019-10-03 16:58:14\",\"created_at\":\"2019-10-03 16:58:14\",\"id\":21}'),
